sys_variable_value.value:
(function execute(inputs, outputs) {

rec = new GlideRecord(inputs.table);

rec.addQuery('name',inputs.recordName);
rec.query();

outputs.count = rec.getRowCount();

if(rec.next()){
    outputs.recid = rec.getUniqueValue();
} else {
    outputs.recid = 0;

}
})(inputs, outputs);

